import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faGitHub,
  faLinkedIn,
  faInstagram
} from "@fortawesome/free-brands-svg-icons";
function SocialFollow() {
  return (
    <div>
      <h3>Social Follow</h3>
    </div>
  );
}
export default SocialFollow;
